import React, { Component } from 'react';
import ReactDom from 'react-dom';
import axios from 'axios';
//引入组件
import { Layout } from 'antd';
import Content_first from './components/Content/目标转化事件/index';
import Content_second from './components/Content/待归因事件/index';
//引入图标
import { SendOutlined } from '@ant-design/icons';
//引入css文件
import 'antd/dist/antd.css';
import './style.css';

const { Header, Footer, Content } = Layout;


class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            events: [],
            attrs: [],
            values: []
        }

    }

    componentDidMount() {
        //接口请求数据
        //events
        axios.get('/events')
            .then((res) => {
                this.setState({
                    events: res.data
                })
                // console.log(this.state.events)
            })
            .catch((err) => {
                console.log(err)
            })
        //attrs
        axios.get('/attrs')
            .then((res) => {
                this.setState({
                    attrs: res.data
                })
                // console.log(this.state.attrs)
            })
            .catch((err) => {
                console.log(err)
            })
        //values
        axios.get('/values')
            .then((res) => {
                this.setState({
                    values: res.data
                })
                // console.log(this.state.values)
            })
            .catch((err) => {
                console.log(err)
            })
    }
    render() {
        return (
            <Layout className='layout'>
                <Header className='header'>
                    归因分析
                </Header>
                <Content className='content'>
                    <h1 className='primarytitle'><SendOutlined className='icon1' />选择事件</h1>
                    <form>
                        <div>

                        </div>
                        <p className='secondarytitle' style={{marginLeft:18}}>目标转化事件：</p>
                        <Content_first events={this.state.events} attrs={this.state.attrs} />
                    </form>
                </Content>
                <Footer className='footer'>
                    Footer
                </Footer>
            </Layout>
        )
    }
}

ReactDom.render(<App />, document.getElementById('root'))
